import React from "react";
import {data} from "../../../utils/data";

const Ingredients = () => {

    // const listItems = data.map((data) =>
    // <li key={data._id}>{data.price}{' '}{data.name}</li>)


    return (
        <>
            {data.map(data => (
                <ul key={data._id}>
                    <img src={data.image}/>
                    <li>{data.price}</li>
                    <li>{data.name}</li>
                </ul>
            ))}
            {/*<ul>{listItems}</ul>*/}
        </>
    );
}

export default Ingredients;
